import React from "react";

import stockholm from "../img/stockholm.PNG";
import bangalore from "../img/bangalore.PNG";
import nairobi from "../img/nairobi.PNG";

const Card = props =>{
    return(
        <div className="card text-center">
            <div className="overflow">
                <img src={bangalore} alt="bangalore" className="card-img-top"></img>
            </div>
        
            <div className="card-body text-dark">
                <h4 className="card-title"> Card </h4>
                <p className="card-text text-secondary">
                this is a paragrpah
                </p>
                <a href="#" className="btn btn-outline-success"> Go Anywhere</a>
            </div>
        </div>
    );
}

export default Card;
